import React from 'react'
import styled from 'styled-components'
const Container=styled.div`
width: 350px;
cursor: pointer;
margin-bottom: 70px;
padding: 6px;
`
const Img=styled.img`
width: 100%;
height: 200px;
background-color: #999;
`
const Details=styled.div`
`
export const Vidcard = () => {
  return (
    <Container><Img/></Container>
  )
}
